  # // b_1200 is the MSB of the fractional part of 2.0/PI
  # // Left shift operation indicates which bits are brought
  # result = 64'F((1201'B(2.0 / PI)[1200 : 0] << shift.u32) & 1201'0x1fffffffffffff);
  # scale = -53 - shift;
  # if exponent(S0.f64) >= 1968 then
  # scale += 128
