  # D0.f64 = ldexp(result, scale)
  S0 = Reg(s0)
  S1 = Reg(s1)
  D0 = Reg(d0)
  # --- compiled pseudocode ---
  shift = (S1[4 : 0].u32) * 53
  if exponent(S0.f64) > 1077:
    shift += exponent(S0.f64) - 1077
  result = float(((TWO_OVER_PI_1201[1200 : 0] << int(shift)) >> (1201 - 53)) & 0x1fffffffffffff)
  scale = -53 - shift
  if exponent(S0.f64) >= 1968:
    scale += 128
  D0.f64 = ldexp(result, scale)
  # --- end pseudocode ---
  result = {'d0': D0._val, 'scc': scc & 1}
  result['d0_64'] = True
  return result

