def _VOPCOp_V_CMP_F_F16(s0, s1, s2, d0, scc, vcc, lane, exec_mask, literal, VGPR, _vars, src0_idx=0, vdst_idx=0, pc=0):
  # Set the per-lane condition code to 0. Store the result into VCC or a scalar register.
  # D0.u64[laneId] = 1'0U;
  # // D0 = VCC in VOPC encoding.
  D0 = Reg(d0)
  VCC = Reg(vcc)
  laneId = lane
  PC = Reg(pc)
  # --- compiled pseudocode ---
  D0.u64[laneId] = 0
  # --- end pseudocode ---
  result = {'d0': D0._val, 'scc': scc & 1}
  if VCC._val != vcc: result['vcc_lane'] = (VCC._val >> lane) & 1
  result['vcc_lane'] = (D0._val >> lane) & 1
  result['d0_64'] = True
  _pc = PC._val if PC._val < 0x8000000000000000 else PC._val - 0x10000000000000000
  result['new_pc'] = _pc
  return result

